const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="head">
                <h1>An<span>Qi</span></h1>
            </div>
            
            <div className="links">
                <a className="nav" href="/project">Project</a>
                <a className="nav" href="/about">About</a>
                <a className="nav .resume" href="/">Resume</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
